                            case 5:
                                resultHtml += '<a href="' + attachment.doc.url + '" target="_blank">[voice]</a>';
                                break;
                            default:
                                resultHtml += '[doc: ' + attachment.doc.title + '], ';
                                break;
                        }
                        break;
                    default:
                        resultHtml += attachment.type + ', ';
                        break;
                }
            });
            return resultHtml;
        } else return '';
    }

    $(document).ready(function () {
        $('#dialogs').DataTable({
            data: messages,
            ordering: false,
            dom: '<"top"iflp<"clear">>rt<"bottom"iflp<"clear">>'
        });
    });
</script>
